/// <summary>The WrapLayer object defines a 3D accessory's inner and outer surfaces and other properties related to layering accessories. These surfaces, or the Inner Cage and Outer Cage, are similar to collision boxes, and describe the surfaces of which other 3D accessories can be placed without clipping or breaking.</summary>
public partial interface WrapLayer : BaseWrap
{
    /// <summary>Gets or sets the AutoSkin property.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    WrapLayerAutoSkin AutoSkin { get; set; }

    /// <summary>&lt;code&gt;CFrame&lt;/code&gt; is used to adjust a binding point for clothing item mesh. Could be used to move and rotate clothing items. This property is intended for fine-tuning only and it is heavily optional.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    CFrame BindOffset { get; set; }

    /// <summary>Allows for disabling of the &lt;code&gt;WrapLayer&lt;/code&gt; object as if it does not exist.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    bool Enabled { get; set; }

    /// <summary>Controls the composition order for layered clothing.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    int Order { get; set; }

    /// <summary>Controls how much underlying clothing items inflate the current clothing item.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    float Puffiness { get; set; }

    /// <summary>Gets or sets the ReferenceMeshContent property.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    string ReferenceMeshContent { get; set; }

    /// <summary>AssetID for reference mesh used to define Inner Cage of a 3D object.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    string ReferenceMeshId { get; set; }

    /// <summary>Reference mesh offset relative to parent MeshPart (in the parent MeshPart space) Note: this property is set up automatically by the FBX importer.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    CFrame ReferenceOrigin { get; set; }

    /// <summary>Reference mesh offset relative to parent MeshPart (in the world space) Note: this property is set up automatically by the FBX importer.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    CFrame ReferenceOriginWorld { get; }

    /// <summary>Allows slight shrinking/expanding of the resulting render mesh, without affecting any other layers.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    float ShrinkFactor { get; set; }
}

/// <summary>The WrapTarget object defines a target. A target is the 3D body with only an outer surface, or an Outer Cage.</summary>
public partial interface WrapTarget : BaseWrap
{
    /// <summary>Defines how much the body mesh can be compressed by clothing.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    float Stiffness { get; set; }
}

/// <summary>&lt;code&gt;WrapTextureTransfer&lt;/code&gt; allows a parent &lt;code&gt;Decal&lt;/code&gt; to be wrapped around its parent &lt;code&gt;MeshPart&lt;/code&gt; based on the cage of its &lt;code&gt;WrapTarget&lt;/code&gt;.</summary>
public partial interface WrapTextureTransfer : Instance
{
    /// <summary>An optional reference mesh used for pruning and validating the target cage.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    string ReferenceCageMeshContent { get; set; }

    /// <summary>Determines the maximum bound of the UV space to include in the transfer.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    Vector2 UVMaxBound { get; set; }

    /// <summary>Determines the minimum bound of the UV space to include in the transfer.</summary>
    /// <remarks>Thread-safe for reading only.</remarks>
    Vector2 UVMinBound { get; set; }
}